                                <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp");
            WriteLiteral(@";Rezistența imuabilității datelor în blockchain are loc mulțumită sinergiei celor trei tehnologii: chei criptografice, un registru distribuit și un&nbsp;<br>protocol de validare. Asta înseamnă că înregistrările păstrate pe un blockchain pot fi considerate de încredere ca atare și nicio bancă sau agenție de reglementare nu le poate sprijini.
                            </p>
